import React from "react";
import Selector from "../Selector/Selector";
import Styles from "./Header.module.scss";
import wa from "../../images/wa.svg";
import vk from "../../images/vk.svg";
import tg from "../../images/tg.svg";

const Header = () => {
  return (
    <div className={Styles.container}>
      <div class="header__mobileBurger">
        <div class="infoBox">
          <div class="header__navigationMobile"></div>
        </div>
      </div>

      <header className={Styles.header}>
        <div className={Styles.left}>
          <h1 className={Styles.heading}>ПРАВИЛА ЖИЗНИ</h1>
          <Selector fields={["акции", "акции2", "акции3", "акции4"]} />
        </div>
        <div className={Styles.contactBox}>
          <a href="">
            <img src={wa} alt="whats app" />
          </a>
          <a href="">
            <img src={tg} alt="telegram" />
          </a>
          <a href="">
            <img src={vk} alt="vkontakte" />
          </a>
        </div>
        <Selector fields={["Москва", "Казань", "Питер", "Лондон"]} />
        <p className={Styles.phone}>+7 800 000 77 11</p>
      </header>
    </div>
  );
};

export default Header;
